import React, { useState, useEffect } from "react";
import { RefreshCw, Bell, Settings } from "lucide-react";
import { Tooltip } from "../ui/Primitives";
import { TOP_NAV } from "../../constants/config";
import { useApp, ACTIONS } from "../../context/AppContext";
import { checkHealth } from "../../services/api";

export default function Topbar({ onRefresh, onOpenCmd, sidebarCollapsed }) {
  const { state, dispatch } = useApp();
  const [apiStatus, setApiStatus] = useState("checking"); // "ok" | "err" | "mock" | "checking"

  // Poll API health every 15s
  useEffect(() => {
    const check = () => {
      checkHealth()
        .then(res => setApiStatus(res.mode === "mock" ? "mock" : "ok"))
        .catch(() => setApiStatus("err"));
    };
    check();
    const iv = setInterval(check, 15000);
    return () => clearInterval(iv);
  }, []);

  const statusDot = {
    ok:       { color:"#3FB950", label:"API LIVE",    pulse:true  },
    mock:     { color:"#D29922", label:"MOCK MODE",   pulse:false },
    err:      { color:"#F85149", label:"API OFFLINE", pulse:false },
    checking: { color:"#7D8590", label:"CHECKING…",  pulse:false },
  }[apiStatus];

  return (
    <header className="topbar">
      <div className="topbar-logo" style={{ width: sidebarCollapsed ? 56 : 240 }}>
        <div className="logo-diamond" />
        {!sidebarCollapsed && <div className="logo-text">OBS<span>IDIAN</span></div>}
      </div>

      <nav className="topnav">
        {TOP_NAV.map((n) => (
          <div key={n}
            className={`topnav-item ${state.activeTopNav === n ? "active" : ""}`}
            onClick={() => dispatch({ type: ACTIONS.SET_ACTIVE_TOPNAV, payload: n })}>
            {n.toUpperCase()}
          </div>
        ))}
      </nav>

      <div className="topbar-right">
        {/* API Health Indicator */}
        <Tooltip tip={`Go backend: ${statusDot.label}`}>
          <div style={{
            display:"flex", alignItems:"center", gap:6,
            padding:"4px 10px",
            border:`1px solid ${statusDot.color}40`,
            background:`${statusDot.color}10`,
            cursor:"default",
          }}>
            <div style={{
              width:7, height:7, borderRadius:"50%",
              background:statusDot.color,
              boxShadow: statusDot.pulse ? `0 0 6px ${statusDot.color}` : "none",
              animation: statusDot.pulse ? "pulse 2s infinite" : "none",
            }}/>
            <span style={{
              fontFamily:"'JetBrains Mono',monospace",
              fontSize:9, fontWeight:600,
              color:statusDot.color,
              letterSpacing:"0.08em",
              textTransform:"uppercase",
            }}>
              {statusDot.label}
            </span>
          </div>
        </Tooltip>

        <Tooltip tip="⌘K — Command palette">
          <input
            className="obs-input"
            style={{ width:200 }}
            placeholder="⌘K  Search commands…"
            onFocus={onOpenCmd}
            readOnly
          />
        </Tooltip>

        <Tooltip tip="Refresh data">
          <button className="icon-btn" onClick={onRefresh}>
            <RefreshCw size={14} />
          </button>
        </Tooltip>

        <Tooltip tip="Notifications">
          <button className="icon-btn">
            <Bell size={14} />
          </button>
        </Tooltip>

        <Tooltip tip="Settings">
          <button className="icon-btn"
            onClick={() => dispatch({ type: ACTIONS.SET_ACTIVE_NAV, payload:"settings" })}>
            <Settings size={14} />
          </button>
        </Tooltip>

        <div className="avatar">SR</div>
      </div>
    </header>
  );
}
